def generate_treasure_key(T, numbers):
    results = []
    for n in numbers:
        if n <= 3:
            results.append('-1')
            continue
        if n % 15 == 0 or n % 3 == 0:
            sum_digits = 0
            for _ in range(n):
                sum_digits = sum_digits * 10 + 5
            results.append(str(sum_digits))
            continue
        if n % 5 == 0:
            sum_digits = 0
            for _ in range(n):
                sum_digits = sum_digits * 10 + 3
            results.append(str(sum_digits))
            continue
        temp = n
        while n > 5:
            n -= 5
            if n % 3 == 0 and (temp - n) % 5 == 0:
                sum_digits = 0
                for _ in range(n):
                    sum_digits = sum_digits * 10 + 5
                for _ in range(temp - n):
                    sum_digits = sum_digits * 10 + 3
                results.append(str(sum_digits))
                break
        else:
            results.append('-1')
    return results

